import React, { useState, useEffect } from 'react';
import { transactionsApi } from '../supabase';

interface Transaction {
  id: number;
  type: 'income' | 'expense';
  amount: number;
  category: string;
  description: string;
  date: string;
  created_at: string;
}

const TransactionViewer: React.FC = () => {
  const [transactions, setTransactions] = useState<Transaction[]>([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const loadTransactions = async () => {
    setLoading(true);
    setError(null);
    
    try {
      const { data, error } = await transactionsApi.fetchTransactions();
      
      if (error) {
        setError(`Error: ${JSON.stringify(error)}`);
        console.error('Error fetching transactions:', error);
      } else {
        setTransactions(data || []);
        console.log('Loaded transactions:', data);
      }
    } catch (err) {
      setError(`Connection error: ${err}`);
      console.error('Connection error:', err);
    }
    
    setLoading(false);
  };

  useEffect(() => {
    loadTransactions();
    
    // Refresh every 5 seconds to show real-time updates
    const interval = setInterval(loadTransactions, 5000);
    
    return () => clearInterval(interval);
  }, []);

  const formatDate = (dateString: string) => {
    return new Date(dateString).toLocaleString();
  };

  return (
    <div style={{ 
      padding: '15px', 
      margin: '10px', 
      borderRadius: '8px',
      background: 'linear-gradient(135deg, #4facfe 0%, #00f2fe 100%)',
      color: 'white',
      boxShadow: '0 4px 15px rgba(0,0,0,0.2)',
      border: '1px solid #fff'
    }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '10px', flexWrap: 'wrap', gap: '10px' }}>
        <div>
          <h3 style={{ 
            margin: '0 0 5px 0', 
            fontSize: '18px',
            fontWeight: 'bold'
          }}>
            ðŸ“Š Transactions ({transactions.length})
          </h3>
          <p style={{ margin: 0, fontSize: '12px', opacity: 0.9 }}>
            Real-time from Supabase
          </p>
        </div>
        <button 
          onClick={loadTransactions} 
          disabled={loading}
          style={{ 
            padding: '8px 16px', 
            backgroundColor: loading ? '#ccc' : '#ff6b6b', 
            color: 'white', 
            border: 'none', 
            borderRadius: '6px',
            fontWeight: 'bold',
            cursor: loading ? 'not-allowed' : 'pointer',
            boxShadow: '0 2px 8px rgba(0,0,0,0.2)',
            transition: 'all 0.3s ease',
            fontSize: '12px',
            whiteSpace: 'nowrap'
          }}
        >
          {loading ? 'ðŸ”„ Loading...' : 'ðŸ”„ Refresh'}
        </button>
      </div>
      
      {error && (
        <div style={{ color: 'red', marginBottom: '10px' }}>
          {error}
        </div>
      )}
      
      <div style={{ maxHeight: '200px', overflowY: 'auto' }}>
        {transactions.length === 0 ? (
          <div style={{ 
            textAlign: 'center', 
            color: 'rgba(255,255,255,0.8)', 
            padding: '20px',
            fontSize: '14px',
            fontStyle: 'italic'
          }}>
            {loading ? 'ðŸ”„ Loading...' : 'ðŸ“­ No transactions found'}
          </div>
        ) : (
          transactions.map((transaction) => (
            <div 
              key={transaction.id} 
              style={{ 
                padding: '10px', 
                margin: '5px 0', 
                backgroundColor: 'rgba(255,255,255,0.9)', 
                borderRadius: '6px',
                border: '1px solid rgba(255,255,255,0.3)',
                boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
                color: '#333'
              }}
            >
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <div>
                  <strong style={{ 
                    color: transaction.type === 'income' ? '#28a745' : '#dc3545',
                    fontSize: '14px'
                  }}>
                    {transaction.type === 'income' ? '+' : '-'}${transaction.amount}
                  </strong>
                  <span style={{ marginLeft: '10px', fontSize: '12px' }}>{transaction.description}</span>
                </div>
                <div style={{ 
                  fontSize: '10px', 
                  color: '#666',
                  backgroundColor: 'rgba(0,0,0,0.1)',
                  padding: '2px 6px',
                  borderRadius: '3px'
                }}>
                  {transaction.category}
                </div>
              </div>
              <div style={{ fontSize: '10px', color: '#666', marginTop: '5px' }}>
                ðŸ•’ {formatDate(transaction.created_at)}
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default TransactionViewer;
